import React, { useState, useEffect } from 'react';

import '../styles/navbar.css';

const NavBar = () => {
  const [activeLink, setActiveLink] = useState('home');
  const [scrolled, setScrolled] = useState(false);

  useEffect(() => {
    const onScroll = () => {
      if (window.scrollY > 50) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    }

    window.addEventListener("scroll", onScroll);

    return () => window.removeEventListener("scroll", onScroll);
  }, []);

  const onUpdateActiveLink = (value) => {
    setActiveLink(value);
  }

  return (
    <nav className={`navbar ${scrolled ? "scrolled" : ""}`}>
      <div className="container">
        <a href="#home" className="brand">meet jo<b>.</b></a>
        <button className="toggle" aria-controls="basic-navbar-nav">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div id="basic-navbar-nav">
          <a href="#home" className={activeLink === 'home' ? 'active navbar-link' : 'navbar-link'} onClick={() => onUpdateActiveLink('home')}>Home</a>
          <a href="#skills" className={activeLink === 'skills' ? 'active navbar-link' : 'navbar-link'} onClick={() => onUpdateActiveLink('skills')}>Skills</a>
          <a href="#projects" className={activeLink === 'projects' ? 'active navbar-link' : 'navbar-link'} onClick={() => onUpdateActiveLink('projects')}>Projects</a>
          <a href="#connect" className={activeLink === 'connect' ? 'active navbar-link' : 'navbar-link'} onClick={() => onUpdateActiveLink('connect')}>Contact</a>
        </div>
      </div>
      <div className="social-icons">
        <a href="https://github.com/joeygitari" target="_blank" rel="noreferrer"><img src={navIcon1} alt=""/></a>
        <a href="https://www.linkedin.com/in/joanne-gitari-48105b235/" target="_blank" rel="noreferrer"><img src={navIcon2} alt=""/></a>
        <a href="https://twitter.com/jo_gitari" target="_blank" rel="noreferrer"><img src={navIcon3} alt=""/></a>
      </div>
      <button className="connect-button" onClick={() => window.location.hash = 'connect'}><span>Let's connect</span></button>
    </nav>
  );
};

export default NavBar;
